import axios from "axios";
import { useEffect, useState } from "react";


const NonFood = () => {
    const [animals, setAnimals] = useState([]);
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        axios.get('https://botw-compendium.herokuapp.com/api/v2/all')
            .then(res=> {
                setAnimals(res.data.data.creatures.non_food)
                setLoaded(true);
            })
            .catch(err=> console.error(err))
    })

    return (
        <div>
            {loaded && animals.map((animal, i) =>
                <div key={i}className='flex marg-left-20'>
                    <div>
                        <p><img src={animal.image} alt="image" id="icon"/></p>
                    </div>
                    <div className="marg-left-20">
                        <h2>{animal.name}</h2>
                    </div>
                </div>
                )}
        </div>
    )
}

export default NonFood;
